{
  "name": "UBX-CFG-SBAS",
  "class_id": "0x06",
  "message_id": "0x16",
  "description": "SBAS configuration",
  "message_type": "get_set",
  "payload": {
    "length": {
      "fixed": 8
    },
    "fields": [
      {
        "name": "mode",
        "byte_offset": 0,
        "data_type": "X1",
        "description": "SBAS mode (see graphic below)",
        "bitfield": {
          "bits": [
            {
              "name": "enabled",
              "bit_start": 0,
              "bit_end": 0,
              "description": "SBAS enabled (1) / disabled (0) - This field is deprecated; use UBX-CFG-GNSS to enable/disable SBAS operation"
            },
            {
              "name": "test",
              "bit_start": 1,
              "bit_end": 1,
              "description": "SBAS testbed: Use data anyhow (1) / Ignore data when in test mode (SBAS msg 0)"
            }
          ]
        }
      },
      {
        "name": "usage",
        "byte_offset": 1,
        "data_type": "X1",
        "description": "SBAS usage (see graphic below)",
        "bitfield": {
          "bits": [
            {
              "name": "integrity",
              "bit_start": 0,
              "bit_end": 0,
              "description": "Use SBAS integrity information. If enabled, the receiver will only use GPS satellites for which integrity information is available."
            },
            {
              "name": "diffCorr",
              "bit_start": 1,
              "bit_end": 1,
              "description": "Use SBAS differential corrections"
            },
            {
              "name": "range",
              "bit_start": 2,
              "bit_end": 2,
              "description": "Use SBAS GEOs as a ranging source (for navigation)"
            }
          ]
        }
      },
      {
        "name": "maxSBAS",
        "byte_offset": 2,
        "data_type": "U1",
        "description": "Maximum number of SBAS prioritized tracking channels (valid range: 0 - 3) to use (obsolete and superseded by UBX-CFG-GNSS in protocol versions 14+)."
      },
      {
        "name": "scanmode2",
        "byte_offset": 3,
        "data_type": "X1",
        "description": "Continuation of scanmode bitmask below (see graphic below). Every bit corresponds to a PRN number. If all bits are set to zero, auto-scan (i.e. all valid PRNs) are searched.",
        "bitfield": {
          "bits": [
            {
              "name": "PRN152",
              "bit_start": 0,
              "bit_end": 0,
              "description": "Enable PRN152 for search"
            },
            {
